INSERT INTO `catalog_pages` (`id`, `parent_id`, `caption_save`, `caption`, `icon_color`, `icon_image`, `visible`, `enabled`, `min_rank`, `club_only`, `order_num`, `page_layout`, `page_headline`, `page_teaser`, `page_special`, `page_text1`, `page_text2`, `page_text_details`, `page_text_teaser`, `vip_only`, `includes`, `room_id`) VALUES
(1, -1, 'frontpage', 'Front Page', 1, 213, '1', '1', 1, '0', 1, 'frontpage', 'catalog_frontpage_headline_shop_EN', '', '', '', 'Redeem a voucher code here:', '', '', '0', '', 0),
(3, -1, '', 'Classic Furni', 1, 2, '0', '0', 1, '0', 100, 'default_3x3', 'catalog_frontpage_headline2_en', '', 'xerameucu', '', '', '', '', '0', '', 0),
(4, -1, '', 'Loja de Pixels', 1, 178, '0', '0', 1, '0', 100, 'info_duckets', 'duckets_header', '', '', '<i><b><font color=\"#591d97\" size=\"16\">O que so os Duckets?</font></b></i><br><br>Os Duckets so uma moeda virtual gratuita que voc pode ganhar todos os dias por jogar o Habbo Hotel.<br><br><i><b><font color=\"#591d97\" size=\"16\">Para que servem?</font></b></i><br><br><li>Descole um <a href=\"event:catalog/open/duckets_badge\">Emblema</a> Exclusivo.</li><li>Consiga <a href=\"event:catalog/open/duckets_furnis\">moblias incrveis</a>.</li><li>Qualquer negcio divertido que a gente inventar.</li><br><i><b><font color=\"#591d97\" size=\"16\">Como ganho uns Duckets?</font></b></i><br><br><li>Entre diariamente! Quanto mais ativo, mais chances de ganhar.</li><li>Voc ganha por cada conquista como <a href=\"event:talent/open/citizenship\">Cidado Habbo</a>.</li><li>Qualquer surpresa que a gente inventar!</li>', '', '', '', '0', '', 0),
(6, 912437, '', 'Eventos 2', 1, 1, '1', '1', 6, '0', 999, 'default_3x3', 'vipheader1', 'vipteaser2', '', 'Thank you for purchasing VIP! This section of the catalogue is especially for our VIP users. The Rares in this section aren\'t cheap, but you can sell them on to non VIP members for a much heftier price!', '', '', '', '0', '', 0),
(8, 912392, 'vip_buy', 'Habbo Club', 1, 172, '1', '1', 1, '0', 1, 'vip_buy', 'hc2_clubtitle', 'clubcat_pic', 'habbo_club', '', '', '', '', '0', '', 0),
(9, 912409, '', 'Bots', 1, 65, '1', '1', 1, '0', 28, 'bots', 'catalog_bots_headline1_en', 'catalog_bots_headline1_en', 'bots', 'They walk, they talk, and they make the perfect addition to any room!', '', 'Choose a bot of your fancy!\r\nNote: You can customise your bot once its in your room.', '', '0', '', 0),
(11, 912420, '', 'My Sales', 1, 70, '1', '1', 1, '0', 1, 'marketplace_own_items', '', '', '', '', '', '', '', '0', '', 0),
(12, 912420, '', 'Offers', 1, 71, '1', '1', 1, '0', 2, 'marketplace', '', '', 'marketplace_offers', '', '', '', '', '0', '', 0),
(13, 912409, '', 'Credit Furni', 1, 146, '1', '1', 1, '0', 1, 'default_3x3', 'catalog_bank_headline1', 'catalog_bank_teaser', '', 'Habbo Exchange is where you can convert your Credits into a tradable currency. You can then use this currency to trade for Furni or just show off your riches in your room.', '', '', '', '0', '', 0),
(14, 912391, 'buyablepets', 'Pet Animals', 1, 8, '1', '1', 1, '0', 1, 'pets3', 'catalog_pet_headline1', 'ctlg_pet_note', 'pets', 'Pets are inhabitants of Habbo Hotel so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.', 'A few things you should know:', '*You can place a pet in your room or take one for a walk with you in other rooms.\r\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\r\n*You can have up to 50 pets in your room, but look after them all!\r\n\r\n\r\n*Look after your pet with food, water and treats.\r\nCheck the Pets\' Accessories.\r\n*Unlock Badges and Achievements by Training your Pet.', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', '0', '', 0),
(15, 912413, '', 'Spaces', 1, 225, '1', '1', 1, '0', 8, 'spaces_new', 'catalog_spaces_headline1_en', '', 'set_pixelnew', 'Floors, wallpapers, landscapes - get a groovy combination for your room. Use our virtual room preview below to test out the combinations before you buy. Select the design and color you like and click buy.', '', '', '', '0', '', 0),
(16, 912409, '', 'Edio Limitada de Raros', 1, 145, '0', '0', 1, '0', 4, 'default_3x3', 'limited_header', '', 'ultd_furni', 'Adquira enquanto h tempo! Edio Limitada de Raros s est disponvel em quantidades limitadas. Uma vez que todas forem vendidas, acabou! Cada Mobi pode ser identificado pelo ID e o LTD logo abaixo deles.', '', '', '', '0', '', 0),
(18, -1, '', 'New Furni', 1, 2, '0', '0', 1, '0', 100, 'default_3x3', 'catalog_frontpage_headline2_en', '', '', '', '', '', '', '0', '', 0),
(22, 912409, 'buy_club', 'Habbo Club', 1, 172, '1', '0', 1, '0', 26, 'default_3x3', 'catalog_header_hc', 'teaser_habboclub', 'hcclub', 'Deixe que esses elegantes pixels repousem em seus Quartos, dando mais sofisticao a tudo. Eles combinam com seus Mobis HC mensais grtis.', '', '', '', '0', '', 0),
(24, 912413, '', 'Windows', 1, 218, '1', '1', 1, '0', 7, 'default_3x3', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en', '', 'Deixe o sol entrar! Tire o mofo do seu Quarto com uma Janela. Quem disse que voc no pode ter uma vista?', '', '', '', '0', '', 0),
(26, 912412, '', 'Lighting', 1, 40, '1', '1', 1, '0', 6, 'default_3x3', 'catalog_dimmers_header1_en', 'catalog_dimmer_teaser_en', '', 'Check out the Mood Lights. Use these items to dim the light in your rooms. Try out different light settings with different wallpapers to see what you get. Talk about lighting with style!', '', 'Click on an item for details.', '', '0', '', 0),
(27, 912389, '', 'Xmas', 1, 90, '1', '1', 1, '0', 240, 'default_3x3', 'catalog_header_xmas15', 'xmas17old', 'old_xmasback', 'Uma exploso do passado: os mobis de Natal do passado fizeram sua apario na Habbo Loja... Adquira-os enquanto voc pode!', '', '', '', '0', '', 0),
(30, 912389, '', 'Modes', 1, 39, '1', '1', 1, '0', 135, 'default_3x3', 'catalog_mode_headline1', 'catalog_mode_teaser1', '', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.', '', '', '', '0', '', 0),
(32, 912389, '', 'Pura', 1, 48, '1', '1', 1, '0', 169, 'default_3x3', 'puraheader', 'catalog_pura_teaser1', '', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Wulles Hotel.', '', '', '', '0', '', 0),
(33, 912389, '', 'Area', 1, 14, '1', '1', 1, '0', 12, 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', '', 'A chunky and sofisticated line for the down-to-earth, studious Wulles. Its simplicty is beautful and will add a welcoming charm to every room.', '', '', '', '0', '', 0),
(34, 912389, '', 'Country', 1, 21, '1', '1', 1, '0', 43, 'default_3x3', 'country_header1_en_001', 'country_teaser1', '', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!', '', '', '', '0', '', 0),
(35, 912389, '', 'Lodge', 1, 37, '1', '1', 1, '0', 108, 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', '', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', '', '', '', '0', '', 0),
(36, 912455, '', 'Plsticos', 1, 46, '1', '1', 6, '0', 170, 'default_3x3_color_grouping', 'catalog_plasto_headline1', '', '', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', '', '', '', '0', '', 0),
(38, 912389, 'bathroomfurnis', 'Bathroom', 1, 17, '1', '1', 1, '0', 27, 'default_3x3', 'bathroom_catahead', 'bcbath_catateaser', '', 'Have fun times with the Bathroom Collection. A little refreshment does not hurt anyone. When least expected...', '', '', '', '0', '', 0),
(39, 912414, '', 'Vegetation', 1, 220, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', '', 'Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful rose or elegant fruit tree...', '', '', '', '0', '', 0),
(40, 912413, '', 'Carpets', 1, 116, '1', '1', 1, '0', 4, 'default_3x3', 'catalog_rugs_headline1_en', 'catalog_rugs_teaser1', '', 'Rugs for all occasions, all non-slip and washable.', '', '', '', '0', '', 0),
(41, 912413, '', 'Walls', 1, 122, '1', '1', 1, '0', 3, 'default_3x3', 'catalog_walls_header_dyn', 'catalog_walls_teaser2_001', '', 'Bring the outdoors in with windows and posters. Transform your surroundings - your walls will never look bare again!', '', '', '', '0', '', 0),
(43, 912389, '', 'Accessories', 1, 11, '1', '1', 1, '0', 10, 'default_3x3', 'catalog_extra_headline1', 'catalog_extra_teaser1', '', 'However you place your essential Furniture, it\'s the finishing touches that count!', '', '', '', '0', '', 0),
(46, 912455, '', 'Presentes do Clube 2016', 1, 214, '1', '1', 6, '0', 1, 'default_3x3', 'catalog_header_habboclub', 'hc_catalog_teaser', 'club_gifts', 'Veja os novos presentes HC! Se voc for HC, escolha entre a seleo de presentes HC.', '', '', '', '0', '', 0),
(47, 912437, '', 'Base furnis', 1, 179, '1', '1', 6, '0', 9, 'default_3x3', 'catalog_header_base', 'base_rentable_teaser', 'duckets_basefurnis', 'Essa linha colorida de Mobis tem tudo o que voc precisa para deixar seu Quarto no style e construir espaos incrveis.', '', '', '', '0', '', 0),
(48, 912389, '', 'Spa', 1, 211, '1', '1', 1, '0', 199, 'default_3x3', 'catalog_header_spa', 'catalog_teaser_spa', '', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Wulles Health Spa relaxing retreat! Robe and slippers not included.', '', '', '', '0', '', 0),
(52, 912412, '', 'Badge Display', 1, 224, '1', '1', 1, '0', 10, 'badge_display', 'catalog_header_badgedisplay', 'badgedisplay_promo2', '', 'You worked hard to get your badges, right? Now\'s the time to show it off, grab a display case and choose your favorite badge to show off!', '', '', '', '0', '', 0),
(53, 912409, '', 'Room Event', 1, 55, '1', '1', 1, '0', 3, 'roomads', 'events_header', '', 'room_ad', '', '', '', '', '0', '', 0),
(55, 912389, '', 'Iced', 1, 72, '1', '1', 1, '0', 92, 'default_3x3', 'catalog_iced_headline1', 'catalog_iced_teaser1', '', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!', '', '', '', '0', '', 0),
(56, 912389, '', 'Alhambra', 1, 12, '1', '1', 1, '0', 15, 'default_3x3', 'alhambra_header', 'alhambra_teaser', '', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!', '', '', '', '0', '', 0),
(57, 912389, '', 'Asian', 1, 15, '1', '1', 1, '0', 14, 'default_3x3', 'catalog_asian_headline1', 'catalog_asian_teaser1', '', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!', '', '', '', '0', '', 0),
(58, 912389, 'bensalem_furnis', 'Bensalem', 1, 18, '1', '1', 1, '0', 28, 'default_3x3', 'catalog_lc_headline2_en', 'catalog_lc_teaser1_en_001', '', 'Glub... glub... glub...', '', '', '', '0', '', 0),
(60, 912389, '', 'Executive', 1, 27, '1', '1', 1, '0', 54, 'default_3x3', 'catalog_exe_headline1_en', 'catalog_exe_teaser_en', '', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?', '', '', '', '0', '', 0),
(61, 912389, '', 'Glass', 1, 29, '1', '1', 1, '0', 71, 'default_3x3', 'catalog_glass_headline1', 'catalog_glass_teaser1', '', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!', '', '', '', '0', '', 0),
(62, 912389, '', 'Gothic', 1, 30, '1', '1', 1, '0', 70, 'default_3x3', 'catalog_gothic_headline1', 'catalog_gothic_teaser1', '', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!', '', '', '', '0', '', 0),
(67, 912389, '', 'Japan', 1, 36, '1', '1', 1, '0', 101, 'default_3x3', 'catalog_jap_headline1', 'catalog_jap_teaser3_en', '', 'We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!', '', '', '', '0', '', 0),
(68, 912389, '', 'Lost Tribe', 1, 38, '1', '1', 1, '0', 108, 'default_3x3', 'losttribe', 'LT_teaser_en', '', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.', '', '', '', '0', '', 0),
(69, 912389, '', 'Neon', 1, 41, '1', '1', 1, '0', 145, 'default_3x3', 'catalog_neon_header1_en', 'catalog_neon_teaser1_en', '', 'New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?', '', '', '', '0', '', 0),
(71, 912389, '', 'Relax', 1, 49, '1', '1', 1, '0', 186, 'default_3x3', 'rela_header_en', 'rela_teaser_en', '', 'Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of a Wulles with a hectic lifestyle!', '', '', '', '0', '', 0),
(72, 912389, '', 'Romantique', 1, 50, '1', '1', 1, '0', 186, 'default_3x3', 'catalog_romantique_headline1', 'catalog_rom_teaser_en', '', 'Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!', '', '', '', '0', '', 0),
(73, 912389, '', 'Scifi', 1, 53, '1', '1', 1, '0', 196, 'default_3x3', 'sf_header_en', 'sf_teaser_en', '', 'Sci Fi convention, outer space, the Moon, we have everything you need to make your own mystical, un-earthly room right here!', '', '', '', '0', '', 0),
(74, 912389, '', 'Shalimar', 1, 54, '1', '1', 1, '0', 199, 'default_3x3', 'catalog_shal_header1_en', 'catalog_shal_teaser_en', '', 'A coleo Shalimar foi lanada originalmente em 2009 para dar um toque de Bolluwood ao Dia de So Valentim. No perca a oportunidade de adquiri-los!', '', '', '', '0', '', 0),
(75, 912389, '', 'Summer', 1, 57, '1', '1', 1, '0', 199, 'default_3x3', 'catalog_shells_header', 'summer_teaser', '', 'Phwoar! Start up the barbie! This range has everything you need for the perfect summer garden!', '', '', '', '0', '', 0),
(76, 912389, '', 'Valentines', 1, 144, '1', '1', 1, '0', 225, 'default_3x3', 'Valentines_header', 'valentine_furni_001', 'classicfurnisvalentim', 'Prepare-se para a volta dos clssicos de So Valentim.', '', '', '', '0', '', 0),
(80, 912419, '', 'FREEZE!', 1, 87, '1', '1', 1, '0', 5, 'default_3x3', 'catalog_cltbs_heade r1_es', 'catalog_cltbs_tease r_es', '', 'Freeze!... and try the newest game to hit Wulles! Team up and plant snowball bombs to snap freeze your competitors. You could say it\'s so cool, it\'s frozen ;)', '', '', '', '0', '', 0),
(85, 912437, '', 'Colecionveis 1', 1, 28, '1', '1', 6, '0', 2, 'default_3x3', 'catalog_collectibles_headline1_en', 'catalog_cltbs_teaser_en', '', 'The Pixel Collectables are the ultimate collectors items, requiring a mammoth 2000 pixels and credits to buy! If you collect all the pieces and manage to put them together in certain ways, you\'ll receive a special effect!', '', '', '', '0', '', 0),
(93, 912437, '', 'Trofus', 1, 221, '1', '1', 6, '0', 999, 'trophies', 'catalog_trophies_headline1_br', '', '', 'Todo mundo  campeo. E agora voc pode presentear quem quiser com Ouro, Prata ou Bronze. Escolha o modelo do Trofu clicando nas setas e depois na cor desejada.', '', '', '', '0', '', 0),
(94, 912437, '', 'Raros 1', 1, 28, '1', '1', 6, '0', 1, 'default_3x3', 'catalog_rares_headline1', 'raresteaser', '', 'Please do not give out rares to your friends or users for no reason, each purchase you make is logged for higher management to review.', '', '', '', '0', '', 0),
(95, 912438, '', 'Fundos para Imagem', 1, 28, '1', '1', 6, '0', 1, 'default_3x3', 'catalog_rares_headline1', 'raresteaser', '', 'This page contains special rares available for staff. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.', '', '', '', '0', '', 0),
(96, 912437, '', 'Theatredome', 1, 28, '1', '1', 6, '0', 999, 'default_3x3', '', '', '', '', '', '', '', '0', '', 0),
(102, 912412, '', 'Rollers', 1, 222, '1', '1', 1, '0', 9, 'default_3x3', 'catalog_roller_headline1', 'catalog_teaser_rollers_en', '', 'Move your imagination. This cool stuff is more than suitable for business and pleasure... Habbo rollers for games and queues. Now available in multipacks.', '', '', '', '0', '', 0),
(103, 912389, '', 'Dinner', 1, 204, '1', '1', 1, '0', 46, 'default_3x3', 'diner', 'catalog_diner_teaser_en', '', 'Originally from the 50\'s this furni has been refurbished and put right into the catalogue! Use this with the Kitchen range for ultimate diner experience!', '', '', '', '0', '', 0),
(112, 912389, '', 'Twilight', 1, 64, '1', '1', 1, '0', 200, 'default_3x3', 'catalog_twilight_header_en', 'ctlg_pic_ads_twi_mist', '', 'I\'ve never read the book, all I know is it has vampires playing basket ball and some heart throb called Edward Cullen, but the furni looks good!', '', '', '', '0', '', 0),
(120, 912419, '', 'Battle Banzai!', 1, 78, '1', '1', 1, '0', 3, 'default_3x3', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'O jogo mais divertido de todos os pixels est de volta ao Hotel! Crie sua prpria arena de Battle e chame os amigos.', '', '', '', '0', '', 0),
(123, -1, '', 'Hello', 1, 35, '0', '0', 1, '0', 100, 'default_3x3', 'catalog_hello_header1_en', 'catalog_hello_teaser1_en', '', 'Hello Furni is available with Pixels and is perfect if you are decorating your room for the very first time. The Furni is yours to keep and therefore cannot be traded.', '', '', '', '0', '', 0),
