(9125253, 912409, 'fairytale19easter', 'Fairytale Easter', 1, 284, '1', '1', 1, '0', 5, 'default_3x3', 'easter13_header', 'easter19_new', '', 'Our Fairytale Easter furni line is here! Create your own fairytale forests and weave your own stories in the Hotel', '', '', '', '0', '', 0),
(9125254, 912439, '', 'Fairytale Easter', 1, 284, '1', '1', 6, '0', 1, 'default_3x3', '', '', '', '', '', '', '', '0', '', 0),
(9125262, 912496, 'foxoutfit19', 'RARE Enchanted Fox Outfit', 1, 42, '1', '1', 6, '0', 4, 'default_3x3', 'catalog_rares_headline1_en', 'easter19_foxrare', '', 'If there was ever a rare clothing item that could be set to go up in value, this might be it. Get yours while you still can!', '', '', '', '0', '', 0),
(9125266, 14, 'obbahwobbah', 'Obbah Wobbah', 1, 255, '1', '1', 1, '0', 2, 'pets', 'catalog_header_cland15', 'haloompa', '', 'These mischievous little pets have travelled all the way from the deep jungles of WobbahLand! Adorable as they are naughty, these little guys love a good sing-a-long. Available for a short time - don\'t miss out!', '', 'Name your pet:', 'Select your color/breed:', '0', '', 0),
(9125268, 912389, '', 'Danish Hygge Furni', 1, 283, '1', '1', 1, '0', 47, 'default_3x3', 'Stars_header', 'nov18_hyggeline', '', 'Walk through the door and sink into a warm pool of comfort and well-being with this Hygge furnis.', 'Choose a furni.', '', '', '0', '', 0),
(9125269, 912389, 'tokyo', 'Tokyo', 1, 281, '1', '1', 1, '0', 201, 'default_3x3', 'japan_header_br', 'tokyo18_gen', '', '', '', '', '', '0', '', 0),
(9125270, 912393, 'talkingfurnis', 'Talkings', 1, 4, '1', '1', 6, '0', 5, 'default_3x3', 'music_header', 'special_offers', '', 'These furnis can talk with peoples.', 'Choose a furni', '', '', '0', '', 0),
(9125271, 912409, 'r19forrestcrown', 'RARE Fairytale Forest Wreath', 1, 42, '1', '1', 1, '0', 4, 'default_3x3', 'catalog_rares_headline1_en', 'easter19_crownrare', '', 'Dress like a forest queen. Or a king, of course. Take a look at this rare clothing item before it leaves the Catalogue forever!', '', '', '', '0', '', 0),
